import ExpenseItem from "./components/ExpenseItem";
import expenses from "./expense";

function expense(exp) {
  return (
    <ExpenseItem
      key={exp.id}
      title={exp.title}
      amount={exp.amount}
      date={exp.date}
    />
  );
}

function App() {
  return (
    <div>
      <h2>Let's get started!</h2>
      {expenses.map()}
    </div>
  );
}

export default App;
